class HzPy
{

    const HZ_DEFAULT_ENCODING       = "gbk";
    const HZ_DEFAULT_INPUT_ENCODING = "utf-8";
    const HZ_GBK_LENGTH = 2;

    //此处必须注释，为什么非要转成GBK，因为对于汉字而言，据本人的认知，GBK编码下的汉字正好占两个字节符合区位码的定义规则(utf-8编码占3个字节)
    static public function getPyByHz($hz, $defRet = '', $isUpper = false, $charSet = self::HZ_DEFAULT_INPUT_ENCODING)
    {/*{{{*/
        $ret = $defRet;
        if(self::HZ_DEFAULT_INPUT_ENCODING == $charSet)
        {
            $hz = self::toGbk($hz);
        }
        if(self::HZ_GBK_LENGTH != strlen($hz))
        {
            return $ret;
        }
        $firstChar  = substr($hz, 0 , 1);
        $firstCode  = ord($firstChar);
        $secondChar = substr($hz, 1, 1);
        $secondCode = ord($secondChar);
        if($firstCode > 160 && $secondCode > 160)
        {
            $code = ($firstCode - 160) * 100 + $secondCode - 160;
            if(isset(self::$HZ2PY_CONF[$code]))
            {
                $ret = self::$HZ2PY_CONF[$code];
                $ret = ($isUpper ? strtoupper($ret) : strtolower($ret));
            }
        }
        return $ret;
    }/*}}}*/

    static public function getPysByHzs($hzs, $defRet = '', $isUpper = false, $charSet = self::HZ_DEFAULT_INPUT_ENCODING)
    {/*{{{*/
        $ret = '';
        if(self::HZ_DEFAULT_INPUT_ENCODING == $charSet)
        {
            $hzs = self::toGbk($hzs);
        }

        for($i = 0; $i < strlen($hzs); $i++)
        {
            $firstChar = substr($hzs, $i , 1);
            if(ord($firstChar) <= 128 || $i == (strlen($hzs) -1))
            {
                $ret .= $firstChar;
                continue;
            }
            $ret .= self::getPyByHz(substr($hzs, $i, 2),$defRet, $isUpper, self::HZ_DEFAULT_ENCODING);
            $i++;
        }
        return $ret;
    }/*}}}*/

    static public function getFirstPyByHzs($hzs, $defRet = '', $isUpper = false, $charSet = self::HZ_DEFAULT_INPUT_ENCODING)
    {/*{{{*/
        $pys = self::getPysByHzs($hzs, $defRet, $isUpper, $charSet);
        return strlen($pys) ? substr($pys, 0, 1) : $defRet;
    }/*}}}*/

    private function toGbk($str)
    {/*{{{*/
        $ret = mb_convert_encoding($str, self::HZ_DEFAULT_ENCODING, self::HZ_DEFAULT_INPUT_ENCODING);
        return $ret;
    }/*}}}*/

